  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:58.626742\",\n\t\"name\": \"effects-of-acrolein-and-other-pesticides-on-water-quality-and-aquatic-biota-in-tule-lake-n\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The objective of this study was to evaluate
  the potential impacts of acrolein and other pesticides on water quality and aquatic
  invertebrates and fish, with a primary focus on the potential effects of acrolein
  applications in waters upstream of the refuge on aquatic biota in Tule Lake NWR.
  This study consisted of water quality monitoring (water temperature, dissolved oxygen,
  conductivity, pH, and turbidity), nutrient monitoring (total nitrogen, total phosphorus,
  and ammonia), and pesticide monitoring water samples (acrolein and organophosphate
  and carbamate pesticides) following tv periods of multiple acrolein applications.
  Prior to initiation of the study, we verified the USGS's sample preservation methods
  for acrolein by spiking Klamath Basin (Lost River) water for various time intervals
  (Sandstrom and Snyder-Conn, in prep.). To evaluate the impacts of ambient water
  quality and potential pesticide concentrations c aquatic biota, we employed 96-hr
  in situ toxicity tests using the waterflea Daphnia magna, fathead minnows Pimephales
  promelas, and the pulmonate snail, Planorvella pierosoma subcrenaum.\",\n\t\"license_title\":
